import React, { useState } from 'react';
import '../style/SoundPage.css';

export default function MusicInsights() {
  const [audioFeaturesRows, setAudioFeaturesRows] = useState([]); // For fetched songs
  const [audioFeaturesInput, setAudioFeaturesInput] = useState({
    instrumentalness: "",
    energy: "",
    valence: "",
    liveness: "",
    acousticness: "",
  });
  const [error, setError] = useState(""); // Error message state
  const [loading, setLoading] = useState(false); // Loading state

  // Fetch songs based on audio features
  const fetchSongsByAudioFeatures = async () => {
    setError(""); // Reset error message
    setAudioFeaturesRows([]); // Clear previous rows
    setLoading(true); // Set loading state

    try {
      // Build query parameters dynamically
      const query = new URLSearchParams(
        Object.entries(audioFeaturesInput).filter(([_, value]) => value.trim() !== "")
      ).toString();

      if (!query) {
        setError("Please provide at least one audio feature value.");
        setLoading(false);
        return;
      }

      const response = await fetch(`http://localhost:8080/songs/audio-features?${query}`);
      if (!response.ok) {
        throw new Error(`Failed to fetch songs. Status: ${response.status}`);
      }

      const data = await response.json();

      if (data.length === 0) {
        setError("No songs found matching the specified audio features.");
      } else {
        setAudioFeaturesRows(data);
      }
    } catch (err) {
      console.error("Error fetching songs:", err);
      setError("An error occurred while fetching songs.");
    } finally {
      setLoading(false); // End loading state
    }
  };

  // Handle input changes for audio features
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setAudioFeaturesInput((prev) => ({ ...prev, [name]: value }));
  };

  return (
    <div id="sound-page-wrapper">
      <div id="navbar">
        <ul>
          <li><a href="http://localhost:3000/">HomePage</a></li>
          <li><a href="http://localhost:3000/search">Search Page</a></li>
          <li><a href="http://localhost:3000/genre">Genre Page</a></li>
          <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
        </ul>
      </div>

      <h1>Track Explorer</h1>

      <div id="page-wrapper">
        <div id="content-wrapper">
          <section className="table-section">
            <h2>Search Songs by Audio Features</h2>
            <div className="controls">
              {["instrumentalness", "energy", "valence", "liveness", "acousticness"].map((feature) => (
                <label key={feature}>
                  {feature.charAt(0).toUpperCase() + feature.slice(1)}:
                  <input
                    type="number"
                    name={feature}
                    step="0.01"
                    min="0"
                    max="1"
                    placeholder="Enter value"
                    value={audioFeaturesInput[feature]}
                    onChange={handleInputChange}
                  />
                </label>
              ))}
            </div>
            <button onClick={fetchSongsByAudioFeatures} disabled={loading}>
              {loading ? "Searching..." : "Search"}
            </button>
            {error && <div className="error-message">{error}</div>}
            {audioFeaturesRows.length > 0 && (
              <table className="data-table">
                <thead>
                  <tr>
                    <th>Track Title</th>
                    <th>URL</th>
                    <th>Instrumentalness</th>
                    <th>Energy</th>
                    <th>Valence</th>
                    <th>Liveness</th>
                    <th>Acousticness</th>
                  </tr>
                </thead>
                <tbody>
                  {audioFeaturesRows.map((row, index) => (
                    <tr key={index}>
                      <td>{row.title}</td>
                      <td>
                        {row.url ? (
                          <a href={`https://${row.url}`} target="_blank" rel="noopener noreferrer">
                            Link
                          </a>
                        ) : (
                          "N/A"
                        )}
                      </td>
                      <td>{row.instrumentalness.toFixed(3)}</td>
                      <td>{row.energy.toFixed(3)}</td>
                      <td>{row.valence.toFixed(3)}</td>
                      <td>{row.liveness.toFixed(3)}</td>
                      <td>{row.acousticness.toFixed(3)}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            )}
          </section>
        </div>
      </div>
    </div>
  );
}
